//import './App.css';
import './FirstContainerStyle.css';
import BoxMovieComponent from './BoxMovieComponent'

function ComponentRow(props) {
  return (

<div className="flex-container MovieRow">
    <BoxMovieComponent className={props.className[0]}src={props.src[0]} title={props.title[0]} summary={props.summary[0]}/>
    <BoxMovieComponent className={props.className[1]}src={props.src[1]} title={props.title[1]} summary={props.summary[1]}/>
    <BoxMovieComponent className={props.className[2]}src={props.src[2]} title={props.title[2]} summary={props.summary[2]}/>
    <BoxMovieComponent className={props.className[3]}src={props.src[3]} title={props.title[3]} summary={props.summary[3]}/>

 </div>


  );
}

export default ComponentRow;
